import './App'
import axios from 'axios';
class App extends Component{
   constructor(){
      super();
      this.state={
     username:''
      }
   }
   handleChange=(e)=>{
      this.setState({
         [e.target.name]:e.target.value
      })
   }
   render(){
      return (
   <div className="App">

  <input type="text"
   name="username"
   value={this.state.username}
   onChange={this.handleChange}
   />

   </div>

        )
   }
}

export default App;
